jobDescription:
En tant que consultant, j'ai accompagné les CMO et Directions Générales de PME, grands groupes, ETI et Startup dans leur transformation digitale, création ou évolution de services. 

Principales missions : 
- Pfizer : Refonte de l'intranet et conception de l'expérience collaborateurs ;
- Chullanka : Conception du site internet e-commerce aux milliers de références produits outdoor ; 
- Randstad : Etude d'impact de la période de formation des nouveaux collaborateurs ;
- Renault Mobility : Conception de l'expérience de la plateforme d'intermédiation du service de location de véhicule ;
- Prixtel : Conception d'un nouveau service de téléphonie 100% gratuit à destination des adolescents : BLU ;
- Onvabosser : Conception de l'application mobile du nouveau service de recrutement grâce aux soft-kills.

jobDescription2:
Développement des sites web et des applications
➢ Participation à l’élaboration du cahier des charges
➢ Analyse des besoins du client ;
➢ Proposer des solutions technico fonctionnelles pour répondre au besoin client ;
➢ Contrôle qualité : réalisation de différents tests en vue de la validation du site web et la correction des bugs ;
➢ Suivi technique et maintenance.
